package cap02;

public class t4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int num = 150;
		
		while(num <= 300){
			System.out.print(num + " ");
			num++;
		}
		System.out.println();
		for (int i = 150; i <=300; i++) {
			System.out.print(i + " ");
		}
	}

}
